import './List.scss';

const List = (props)=>{

    const {name} = props.data;
    console.log('props.data',props.data);

    return (
        <div>
            <h3>{props.title}</h3>
            <ul>
                <li>{name}</li>
            </ul>
        </div>
    )
}

export default List;
